import React from 'react';
import PropTypes from 'prop-types';

const TestBody = ({ searchObjects }) => {
    searchObjects();

    return (
        <div>
            <h3>Test</h3>
        </div>
    )
}

TestBody.propTypes = {
    searchObjects: PropTypes.func.isRequired,
}

export default TestBody;
